Die Söhne Simeons waren nach ihren Familien: Namuel, von welchem die Familie der Namueliter; Jamin, von welchem die Familie der Jaminiter; Jachin, von welchem die Familie der Jachiniter;
Zare, von welchem die Familie der Zareiter; Saul, von welchem die Familie der Sauliter herstammt.
Das sind die Familien vom Stamme Simeon; ihre Gesamtzahl war zweiundzwanzigtausend zweihundert.
